// SPDX-License-Identifier: MIT
pragma solidity 0.8.20;

import {IHandler} from "./interfaces/IHandler.sol";
import "hardhat/console.sol"; // Import Hardhat console library


contract BridgeIN {
    address owner;
    uint public depositNonce;
    address public erc20Handler;

    modifier onlyOwner() {
        _onlyOwner();
        _;
    }

    function _onlyOwner() private view {
        require(msg.sender == owner, "sender must be owner");
    }

    constructor(){
        owner = msg.sender;
    }

    event Deposit(
        address tokenAddress,
        address depositor,
        uint amount,
        uint nonce
    );

    function deposit(
        address tokenAddress,
        address depositor,
        uint256 amount
    ) external {

        depositNonce++;

        IHandler depositHandler = IHandler(erc20Handler);
        (address returnedTokenAddress, address returnedDepositor, uint256 returnedAmount) = depositHandler.deposit(tokenAddress, depositor, amount);

        console.log("============| returnedTokenAddress:", returnedTokenAddress);
        console.log("============| returnedDepositor:", returnedDepositor);
        console.log("============| returnedAmount:", returnedAmount);


        emit Deposit(returnedTokenAddress, returnedDepositor, returnedAmount, depositNonce);
        // emit Deposit(tokenAddress, depositor, amount, depositNonce);
    }

    function handleWithdraw(address token, uint amount, uint64  withdrawNonce, address user) external returns(address _user) {
        console.log("================ Got new Withdraw| User:", user);
        return user;
    }

    function setHandler(address _handler) external onlyOwner {
        erc20Handler = _handler;
    }

    function setToken(address _token, bool _isBurnable, bool _isWhitelisted) external onlyOwner {
        IHandler depositHandler = IHandler(erc20Handler);
        depositHandler.setResource(_token, _isBurnable, _isWhitelisted);
    }
}

contracts/interfaces/IHandler.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.20;

/**
    @title Interface for handler that handles generic deposits and deposit executions.
    @author ChainSafe Systems.
 */
interface IHandler {
    function deposit(address tokenAddress, address depositor, uint256 amount) external returns (address, address, uint256);
    function executeProposal(uint256 amount, address tokenAddress, address recipientAddress) external returns (uint256 _amount);
    function setResource(address token, bool isBurnable, bool isWhitelisted) external;
}

